import React, { useEffect, useState } from "react";

function Dictionary() {
  const [word, setWord] = useState("");
  const [word2, setWord2] = useState("");

  useEffect(() => {
    console.log("word update", word + " " + word2);
  }, [word]);

  return (
    <>
      <div className="w-9/12 pb-10 mt-5 mx-auto">
        <input type="text" onChange={(e) => setWord(e.target.value)} />
        <h2>Let's get the definition. {word}</h2>
      </div>

      <div className="w-9/12 pb-5 mt-5 mx-auto">
        <input type="text" onChange={(e) => setWord2(e.target.value)} />
        <h2>Let's get the definition. {word2}</h2>
      </div>
    </>
  );
}

export default Dictionary;
